import React from "react"
import "./fundoPreto.css"

function Home(props) {
    const { name } = props
    return (
        <button className="fundoPreto fundoPretoMenor">{name}</button>
    )
}

const Following = (props) => {
    const { name } = props
    return (
        <button className="fundoPreto">{name}</button>
    )
}

function Search(props) {
    const { name } = props
    return (
        <input className="search" placeholder="Search">{name}</input>
    )
}

export default Home
export {Following}
export {Search}
